import React from 'react';
import propTypes from 'prop-types';

export default function Percantage({caught, total}){
    const percent = caught / total * 100;

    return(
        <div id="Progress-Container">
            <div id="Progress-Outer">
                {/*<div id="Progress-Numbers">
                    <b>{percent}%</b> Done! <span id="Progress-Info-Span">
                        (<b>{caught}</b> caught, <b>{total - caught}</b> to go)
                    </span>
                </div>*/}
                <div id="Progress-Inner" style={{width: `${percent}%`}}/>
            </div>
        </div>
    )
}

Percantage.propTypes = {
    caught: propTypes.number.isRequired,
    total: propTypes.number.isRequired
};
